import React from 'react';
import MyPosts from './MyPosts';
import { arajin, erkrord } from '../../../redux/mr.js';
import StoreContext from '../../../StoreContext';

const PostsMy = (props) => {
  return (
    <StoreContext.Consumer>
      {(store) => {
        let state = store.getState();

        let add = () => {
          store.dispatch(arajin());
        };

        let change = (text) => {
          let ac = erkrord(text);
          store.dispatch(ac);
        };
        return (
          <MyPosts
            change={change}
            add={add}
            mymsg={state.messagePage.mymsg}
            adText={state.messagePage.adText}
          />
        );
      }}
    </StoreContext.Consumer>
  );
};

export default PostsMy;
